//
//
public class rq2 {

/// Strings     retrieved as Expressed Sequence tags from Genomic Library after dideoxy sequencing
	//Use this method to determine ACTG nucleotide composition of EST element

	public static int ACTGNucleotideLength (String GenomeSpecimen, String nucleotide) {

		if (GenomeSpecimen.length() == 0 || nucleotide.length() == 0) return 0;


		int ESTLength = GenomeSpecimen.length();
		int ACTGDifferential = nucleotide.length();

		// terminating sequence element correspondence check
		if (GenomeSpecimen.charAt(ESTLength - 1) == nucleotide.charAt(ACTGDifferential - 1)) {


			// increment ACTG nucleotide length and cleave last sequence element from both


			return 1 + ACTGNucleotideLength(GenomeSpecimen.substring(0, ESTLength - 1), 
					nucleotide.substring(0, ACTGDifferential - 1));

		} else {
			//ACTG nucleotide sequence not found within expressed sequence tag
			//perform genomic splice on EST and try again 
			// or attempt to find match within nucleotide subsequence with DNA cleavage



			return Math.max(

					ACTGNucleotideLength(GenomeSpecimen.substring(0, ESTLength - 1), 
										nucleotide.substring(0, ACTGDifferential)),
					ACTGNucleotideLength(GenomeSpecimen.substring(0, ESTLength), 
										nucleotide.substring(0, ACTGDifferential - 1))
					);
		}
	}


	}
